import React from 'react';
import CharContainer from '../char-container';

import './app.css';

const App = () => {
    return (
        <main className='main'>
            <h1 className='main__title'>Pokedex</h1>
            <CharContainer/>
            <section></section>
        </main>
    )
}

export default App;
